import React, { Component } from 'react';
import Title from './Title';
import PlanetCard from './PlanetCard';
import Planets from '../data/planets';

class SolarSystem extends Component {
  render() {
    return (
      <div data-testid="solar-system" className="container" style={{display: 'flex', flexDirection: 'column'}}>
        <Title headline="Planetas" />
        <div >
          {
            Planets
              .map(
                (
                  { name, image },
                ) => <PlanetCard key={ name } planetImage={ image } planetName={ name } style={{flexDirection: 'row'}}/>,
              )
          }
        </div>
      </div>
    );
  }
}

export default SolarSystem;
